import Header from "./components/header/Header";
import SpecialDishes from "./components/specialDishes/SpecialDishes";
import MenuDishes from "./components/menuDishes/MenuDishes";

function App() {
  return (
    <div>
      <Header />
      <div>
      <section className="section">
        <SpecialDishes />
      </section>
      <section className="section">
        <MenuDishes />
      </section>
      </div>
      <footer></footer>
    </div>
  );
}


export default App;
